Penyanyinya Theodora Athia, biasa dipanggil Dolly, anak sulung Haji Agus Salim.

Mendengarkan lagu itu dengan spontan para hadirin berdiri dan ikut menyanyi.

Lagu Indonesia Raya kembali dinyanyikan pada konges kedua Partai Nasional Indonesia (PNI) di Jakarta, 18-20 Desember 1929.

Untuk memeriahkan kongres, Supratman diminta memperdengarkan lagu Indonesia Raya dengan gesekan biolanya bersama suatu orkes.

“Ketika lagu kebangsaan itu hendak dimulai, maka lebih dahulu Bung Karno selaku Pemimpin Umum P.N.I. menyerukan: ... ‘semua hadirin diminta berdiri, untuk menghormat lagu kebangsaan Indonesia Raya’,” tulis Oerip Kasansengari dalam Lagu Kebangsaan Indonesia Raya dan W.R. Soepratman Pentjiptanja.

“Sejak itu hingga pada saat ini dan seterusnya apabila lagu kebangsaan Indonesia Raya dinyanyikan, maka selalu dihormati dan dinyanyikan dengan berdiri.”

